import React from 'react';

const NoticeList = (props, {onChage}) => {

    return (
        <Link href={{pathname:'/noticeInfo', query:{NTC_ID:props.props.NTC_ID}}}><li key={props.props.NTC_ID}>{props.props.NTC_TITLE}</li></Link>
    )
};

export default NoticeList;
